import React, { Component } from "react";
import Layout from "../components/Layout";
import Detail from "./detail";

class Index extends Component{
    render(){
        console.log(this.props.blogs);
        return(
            <Layout>                
                <div className="container">
                    <div className="text-center">
                        <h4>Game Developer and Video Creater</h4>
                        <p className="text-left"></p>
                    </div>                   
                    <div className="row d-flex justify-content-center">
                        <Detail title1 = "The Resume Game" img = "/static/images/products/TheResume/theresume.png" />
                        <Detail title1 = "Game 2" />
                        <Detail title1 = "Game 3" />
                        <Detail title1 = "Game 4" />
                        <Detail title1 = "Game 5" />
                        <Detail title1 = "Game 6" /> 
                    </div>
                </div>          
            </Layout>               
        )
    }
}

export default Index;
